import { gql } from '@apollo/client';

export const GET_POSTS = gql`
  query GetPosts {
    posts {
      nodes {
        id
        title
        content
        slug
      }
    }
  }
`;

export const GET_HEADER_SETTINGS = gql`
query HeaderSettings {
  themeSettings {
    themeSettingsFields {
      navigation {
        fieldGroupName
        buttons {
          fieldGroupName
          label
          url
        }
        logo {
          node {
            sourceUrl
          }
        }
      }
    }
    id
  }
}`;

export const GET_PAGE_BY_SLUG = gql`
  query GetPageBySlug($slug: String!) {
    pageBy(uri: $slug) {
      id
      title
      content
      template {
        templateName
      }
    }
  }
`;

export const GET_PAGE_DATA = gql`
  query GetPageData($slug: String!) {
    pageBy(uri: $slug) {
      acf {
        top_video_section {
          video {
            url
          }
          text
          buttons {
            button_text
            button_url
          }
        }
        text_right_image {
          text
          image {
            url
          }
        }
      }
    }
  }
`;
